// pulsar
function pulsar() {
	$('body').animate({backgroundColor:"#aa3be9"}, 1000);
	$('body').css({
		backgroundImage: 'url("images/pulsar.png")',
		backgroundPosition: '0 0',
		backgroundRepeat: 'repeat-y'
	});
	$('ul.icons li a').css({
		color:'#000000',
		backgroundImage:'url("images/icons_pulsar.png")',
		opacity:'0.25'
	});
	$('body').animate({backgroundColor:"#e93b73"}, 5000)
		.animate({backgroundColor:"#ff6a00"}, 5000)
		.animate({backgroundColor:"#e7e93b"}, 5000)
		.animate({backgroundColor:"#47e93b"}, 5000)
		.animate({backgroundColor:"#3bd2e9"}, 5000)
		.animate({backgroundColor:"#aa3be9"}, 5000);
}
// konami code
var konami = readCookie('konami');
if(!konami) {
	var keySequence = [], konamiCode = '38,38,40,40,37,39,37,39,66,65';
	if(window.addEventListener) {
		window.addEventListener('keydown', function(e){
			keySequence.push(e.keyCode);
			if(keySequence.toString().indexOf(konamiCode) >= 0) {
				eraseCookie('fx'); createCookie('theme', 'contra', expires); createCookie('konami', ' true', expires);
				location.reload();
			}
		}, true);
	}
}